// Import custom components
import ExpenseItem from "./components/ExpenseItem";
import AddNew from "./components/AddNew";

function App() {
  return (
    <div>
      <div>
        <h2>Let's get started!</h2>
        <ExpenseItem></ExpenseItem>{" "}
        {/* Now we can use it as a normal HTML element*/}
        <ExpenseItem></ExpenseItem>
      </div>
      <AddNew></AddNew>
    </div>
  );
}

export default App;
